import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

function HeartPredictionForm() {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    age: '', sex: '', cp: '', trestbps: '', chol: '',
    fbs: '', restecg: '', thalach: '', exang: '',
    oldpeak: '', slope: '', ca: '', thal: ''
  });

  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);

  // 🔐 Redirect to login if no token
  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) {
      navigate('/login');
    }
  }, [navigate]);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (loading) return;

    setError(null);
    setLoading(true);

    try {
      const token = localStorage.getItem('token');
      const response = await axios.post(
        'http://127.0.0.1:8000/api/heart-predict/',
        formData,
        {
          headers: {
            Authorization: `Bearer ${token}`
          }
        }
      );

      if (response.data.prediction !== undefined) {
        navigate('/heart-result', {
          state: {
            input: formData,
            result: response.data
          }
        });
      } else {
        setError('Prediction failed.');
      }
    } catch (err) {
      if (err.response?.status === 401) {
        setError('Unauthorized. Please log in again.');
        navigate('/login');
      } else {
        setError('Prediction failed. Please check the input or server.');
      }
    }

    setLoading(false);
  };

  const fields = [
    { label: "Age", name: "age" },
    { label: "Sex (1=Male, 0=Female)", name: "sex" },
    { label: "Chest Pain Type (0-3)", name: "cp" },
    { label: "Resting BP", name: "trestbps" },
    { label: "Cholesterol", name: "chol" },
    { label: "Fasting BS (1/0)", name: "fbs" },
    { label: "Resting ECG (0-2)", name: "restecg" },
    { label: "Max Heart Rate", name: "thalach" },
    { label: "Exercise Angina (1/0)", name: "exang" },
    { label: "ST Depression", name: "oldpeak" },
    { label: "Slope (0-2)", name: "slope" },
    { label: "Major Vessels (0-3)", name: "ca" },
    { label: "Thal (1=Norm, 6=Fix, 7=Rev)", name: "thal" }
  ];

  return (
    <>
      {/* 🔼 Navbar */}
      <nav className="navbar navbar-expand-lg navbar-dark bg-success">
        <div className="container">
          <a className="navbar-brand fw-bold" href="/">🏥 Health Predictor</a>
          <button className="btn btn-light btn-sm" onClick={() => navigate('/')}>
            ⬅ Home
          </button>
        </div>
      </nav>

      {/* 🔽 Main Form */}
      <div className="d-flex justify-content-center align-items-center vh-100" style={{ background: '#e3f2fd' }}>
        <div className="p-4 rounded-4 shadow-sm" style={{ background: '#ffffff', width: '100%', maxWidth: '450px' }}>
          <h3 className="text-center fw-bold mb-3 text-success">❤️ Heart Disease Predictor</h3>

          <form onSubmit={handleSubmit}>
            {fields.map(({ label, name }) => (
              <div className="form-floating mb-2" key={name}>
                <input
                  type="number"
                  step="any"
                  className="form-control"
                  id={name}
                  name={name}
                  placeholder={label}
                  value={formData[name]}
                  onChange={handleChange}
                  required
                />
                <label htmlFor={name}>{label}</label>
              </div>
            ))}

            <button type="submit" className="btn w-100 fw-bold mt-2" style={{ backgroundColor: '#1565c0', color: 'white' }}>
              {loading ? '⏳ Predicting...' : '🚀 Predict'}
            </button>
          </form>

          {error && (
            <div className="alert alert-danger mt-3">
              ❌ {error}
            </div>
          )}
        </div>
      </div>
    </>
  );
}

export default HeartPredictionForm;
